import React, { Component } from "react";
import { Link } from "react-router-dom";
import Search from "./Search";
import Welcome from "./Welcome";
import Message from "./Message";
export class Home extends Component {
  render() {
    return (
      <div>
        <Link style={removeTextDecoration} id='settings-button' to='/settings'>
          {" "}
          asdas{" "}
        </Link>
        {/* <div className='settings-content'> */}
        <Welcome
          getActiveUser={this.props.getActiveUser}
          getCurrentHour={this.props.getCurrentHour}
        />
        <Search />
        <Message
          getActiveUser={this.props.getActiveUser}
          getCurrentDay={this.props.getCurrentDay}
          getCurrentMonth={this.props.getCurrentMonth}
        />
      </div>
    );
  }
}
const removeTextDecoration = {
  textDecoration: "none"
};
export default Home;
